import React, {StrictMode} from 'react';
import {Component} from 'react';
import CardList from './CardList';
import {robots} from './robots';
import SearchBox from './SearchBox';

const state = {
    robots: robots,
    searchfield: ''
}

class App extends Component  {
    rendeer () {
    return (
        <div className='tc'>
            <h1>RoboFriends</h1>
            <SearchBox />
        <CardList robots={robots}/>
        </div>
    );
  }
}

export default App;
